def is_prime(n):
    if n < 1:
        return False
    if n == 2:
        return True
    if n % 2 == 0:
        return False
    max_div = round(n ** 0.5) + 1
    for i in range(3, max_div, 2):
        if n % i == 0:
            return False
    return True

def next_prime(n):
    prime_candidate = n + 1
    while not is_prime(prime_candidate):
        prime_candidate += 1
    return prime_candidate

def fibonacci(n):
    (a, b) = (0, 1)
    for _ in range(n):
        (a, b) = (b, a + b)
    return b

def construct_spiral(n, pattern, extra=0):
    elements = [n + extra]
    for _ in range(n - 1):
        if pattern == 'prime':
            elements.append(next_prime(elements[-1]))
        elif pattern == 'fibonacci':
            elements.append(fibonacci(len(elements) + 1) + extra)
    return elements

